// frontend/src/pages/TestApi.jsx
import React, { useState, useEffect } from 'react';
import unifiedService from '../services/unifiedService';

const TestApi = () => {
  const [results, setResults] = useState({});
  const [loading, setLoading] = useState(false);

  const testAllEndpoints = async () => {
    setLoading(true);
    const testResults = {};

    try {
      // 1. Health Check
      testResults.health = await unifiedService.checkHealth();
    } catch (error) {
      testResults.health = { error: error.message };
    }

    try {
      // 2. Users
      testResults.users = await unifiedService.getUsers();
    } catch (error) {
      testResults.users = { error: error.message };
    }

    try {
      // 3. Games
      testResults.games = await unifiedService.getGames();
    } catch (error) {
      testResults.games = { error: error.message };
    }

    try {
      // 4. Branches
      testResults.branches = await unifiedService.getBranches();
    } catch (error) {
      testResults.branches = { error: error.message };
    }

    try {
      // 5. Dashboard Stats
      testResults.stats = await unifiedService.getDashboardStats();
    } catch (error) {
      testResults.stats = { error: error.message };
    }

    setResults(testResults);
    setLoading(false);
  };

  useEffect(() => {
    testAllEndpoints();
  }, []);

  const renderResult = (key, data) => {
    if (data.error) {
      return <div style={{ color: 'red' }}>‚ùå {data.error}</div>;
    }
    
    if (data.success === false) {
      return <div style={{ color: 'orange' }}>‚ö†Ô∏è {data.message}</div>;
    }
    
    return (
      <div style={{ color: 'green' }}>
        ‚úÖ Success - Data: {JSON.stringify(data.data?.length || data.data)}
      </div>
    );
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>üîß ÿßÿÆÿ™ÿ®ÿßÿ± ÿßÿ™ÿµÿßŸÑ API</h1>
      
      <button onClick={testAllEndpoints} disabled={loading}>
        {loading ? 'ÿ¨ÿßÿ±Ÿä ÿßŸÑÿßÿÆÿ™ÿ®ÿßÿ±...' : 'ÿ™ÿ¥ÿ∫ŸäŸÑ ÿ¨ŸÖŸäÿπ ÿßŸÑÿßÿÆÿ™ÿ®ÿßÿ±ÿßÿ™'}
      </button>

      <div style={{ marginTop: '20px' }}>
        <h2>ÿßŸÑŸÜÿ™ÿßÿ¶ÿ¨:</h2>
        
        <div style={{ display: 'flex', flexDirection: 'column', gap: '15px' }}>
          <div>
            <h3>üè• Health Check</h3>
            {renderResult('health', results.health || {})}
          </div>
          
          <div>
            <h3>üë• ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖŸäŸÜ</h3>
            {renderResult('users', results.users || {})}
          </div>
          
          <div>
            <h3>üéÆ ÿßŸÑÿ£ŸÑÿπÿßÿ®</h3>
            {renderResult('games', results.games || {})}
          </div>
          
          <div>
            <h3>üè¨ ÿßŸÑŸÅÿ±Ÿàÿπ</h3>
            {renderResult('branches', results.branches || {})}
          </div>
          
          <div>
            <h3>üìä ÿ•ÿ≠ÿµÿßÿ¶Ÿäÿßÿ™ Dashboard</h3>
            {renderResult('stats', results.stats || {})}
          </div>
        </div>
      </div>

      <div style={{ marginTop: '30px', padding: '15px', background: '#f0f0f0' }}>
        <h3>üîç ŸÖÿπŸÑŸàŸÖÿßÿ™ ÿßŸÑÿ™ÿµÿ≠Ÿäÿ≠:</h3>
        <p>Token: {localStorage.getItem('token') ? '‚úÖ ŸÖŸàÿ¨ŸàÿØ' : '‚ùå ÿ∫Ÿäÿ± ŸÖŸàÿ¨ŸàÿØ'}</p>
        <p>User: {localStorage.getItem('user') ? '‚úÖ ŸÖŸàÿ¨ŸàÿØ' : '‚ùå ÿ∫Ÿäÿ± ŸÖŸàÿ¨ŸàÿØ'}</p>
        <p>Backend URL: http://localhost:5000</p>
      </div>
    </div>
  );
};

export default TestApi;
